import database.HltvDatabaseManager;import general.logics.AdvantageGenerator;import hltv.matches.teams.Team;import resultMatches.MatchResult;import java.io.File;import java.util.Scanner;public class Main {    public static void main(String[] args) throws Exception {        Scanner scanner = new Scanner(new File("src/main/java/resultMatches/resultLinks.txt"));        int number = 0;        while (scanner.hasNextLine()) {            number++;            System.out.println("Match â„–" + number);            System.out.println("Match download...");            MatchResult matchResult = new MatchResult(scanner.nextLine());            System.out.println("Match downloaded successfully\n");            try {                System.out.println("First team download...");                Team firstTeam = new Team(matchResult.getFirstTeamLink());                System.out.println("First team downloaded successfully\n");                System.out.println("Second team download...");                Team secondTeam = new Team(matchResult.getSecondTeamLink());                System.out.println("Second team downloaded successfully\n");                AdvantageGenerator generator = new AdvantageGenerator(firstTeam, secondTeam);                System.out.println("Database filling...");                HltvDatabaseManager manager = new HltvDatabaseManager(generator, matchResult);                manager.fillLine();                System.out.println("Database filled successful\n");            } catch (Exception e) {                e.printStackTrace();                Thread.sleep(300000);            } finally {                for (int i = 0; i < 35; i++) {                    System.out.print("*");                }                System.out.println("");            }        }    }}